import React from 'react';
import Header from '../components/header/header';
import Footer from '../components/footer/footer';

var Landing = () => {

    var hList = [
        <li><a href="/">About</a></li>
    ];

    var body = () => {
        return(
            <div class="body">
                <h2>Torch.fyi, the talent repository.</h2>
            </div>
        )
    }

    return(
        <div>
            <Header list = {hList}/>
            {body()}
            <Footer/>
        </div>
    )
}

export default Landing;
